const getOriginal = (patchChain) => typeof patchChain.prev === "function"
    ? patchChain.prev
    : getOriginal(patchChain.prev);
export default (patcherId, obj, funcName) => {
    const patchChain = obj[patcherId][funcName];
    if (patchChain === undefined)
        return obj[funcName];
    return getOriginal(patchChain);
};
